import React from 'react';
import Persons from './components/Persons'
const NameList=()=>{
    const persons=[
        {
            id:1,
            name:'shivam'
        },
        {
            id:2,
            name:'rakesh'
        },
        {
            id:3,
            name:'satyam'
        }
    ]
const personlist= persons.map((person) => <h2>{person.id} name- {person.name}</h2>)
    return(
      <Persons/>
    )
}
export default NameList
